    false,nt"url": null,nt"notes": "Numbers of Sandplain Gerardia on Long Island
    increased to approximately 14,000 plants in 2001. In the five year period 1997-2001
    numbers of plants have increased more than seven-fold. This success is due to several
    ongoing actions: management to maintain native grassland habitat suitable for Sandplain
    Gerardia, fencing to prevent browse damage due to rabbits, and moving seeds to new
